              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              id="username" // Added username field
              label="Username"
              name="username"
              value={userName}
              autoComplete="username"
              onChange={(event) => setUserName(event.target.value)}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              id="dob" // Added DOB field
              label="Date of Birth"
              name="dob"
              type="date"
              value={dob}
              onChange={(event) => setDob(event.target.value)}
              InputLabelProps={{
                shrink: true,
              }}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              value={password}
              onChange={(event) => setPassword(event.target.value)}
              autoComplete="current-password"
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              Sign In
            </Button>
          </Box>
        </Box>
        {error && <div className="alert alert-danger" role="alert">{error}</div>}
                    <button type="submit" className="btn btn-danger">Signup</button>
      </Container>
    </ThemeProvider>
  );
}

export default SignIn;
